export const findMappingIndexForPoint = (latitude: number, longitude: number): number =>
  cities.find((city) =>
    booleanPointInPolygon(
      point([longitude, latitude]),
      city.type === 'P'
        ? multiPolygon([city.coordinates as number[][][]])
        : multiPolygon(city.coordinates as number[][][][])
    )
  )?.mapping ?? -1;
